import React from 'react';
import './App.css';
import Pokecard from './Pokecard/Pokecard';

function App() {
  return (
    <div className="App">
      <Pokecard
        id="bulbasaur"
        name="Bulbasaur"
        type="grass"
        baseExperience={53}
        />
    </div>
  );
}

export default App;
